import { makeStyles } from '@mui/styles';

export default makeStyles({
  container: {
    background: 'rgb(7 10 16 / 0%)',
    height: '80px',
    position: 'static',
    bottom: '0'
  },
  title: {
    fontSize: '22px',
    marginTop: '15px'
  },
  subtitle: {
    fontFamily: 'Copperplate',
    fontStyle: 'normal',
    fontWeight: 'normal',
    fontSize: '12px',
    lineHeight: '12px',
  }
});
